import React, { Component } from "react";

class Tabs extends Component {
  state = {
    categoriesArray: [
      {
        id: "cat1",
        name: "market"
      },
      {
        id: "cat2",
        name: "school"
      }
    ]
  };
  render() {
    return (
      <p className="panel-tabs">
        <a className="is-active">All</a>
        {this.state.categoriesArray.map(elem => (
            <a>{elem.name}</a>
        ))}
        <a>+ Add Category</a>
      </p>
    );
  }
}

export default Tabs;
